import React, { useState, useEffect } from 'react';
import styles from './styles/BookingForm.css';

function BookingForm() {
    const [origen, setOrigen] = useState('');
    const [destino, setDestino] = useState('');
    const [dia, setDia] = useState('');
    const [suggestionsOrigen, setSuggestionsOrigen] = useState([]);
    const [suggestionsDestino, setSuggestionsDestino] = useState([]);
    const [showSuggestionsOrigen, setShowSuggestionsOrigen] = useState(false);
    const [showSuggestionsDestino, setShowSuggestionsDestino] = useState(false);
    const [activeSuggestionIndexOrigen, setActiveSuggestionIndexOrigen] = useState(-1);
    const [activeSuggestionIndexDestino, setActiveSuggestionIndexDestino] = useState(-1);

    const handleSubmit = async (event) => {
        event.preventDefault();
        // Enviar datos al backend
        const response = await fetch('http://localhost:3000/v1/crearViajes', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ origen, destino, dia }),
        });
        const data = await response.json();
        console.log(data);
    };

    const fetchSuggestions = async (input, setSuggestions, setShowSuggestions, setActiveSuggestionIndex) => {
        try {
            const response = await fetch(`http://localhost:3000/v1/getSuggestions?query=${input}`);
            if (response.ok) {
                const data = await response.json();
                setSuggestions(data);
                setShowSuggestions(true);
            } else {
                console.error('Error al obtener las sugerencias');
            }
        } catch (error) {
            console.error('Error al enviar la solicitud:', error);
        }
    };

    const handleOriginChange = async (event) => {
        const inputValue = event.target.value;
        setOrigen(inputValue);
        fetchSuggestions(inputValue, setSuggestionsOrigen, setShowSuggestionsOrigen, setActiveSuggestionIndexOrigen);
    };

    const handleDestinationChange = async (event) => {
        const inputValue = event.target.value;
        setDestino(inputValue);
        fetchSuggestions(inputValue, setSuggestionsDestino, setShowSuggestionsDestino, setActiveSuggestionIndexDestino);
    };

    const handleSuggestionClick = (index, setOrigen, setDestino, setShowSuggestionsOrigen, setShowSuggestionsDestino) => {
        if (index === activeSuggestionIndexOrigen) {
            setOrigen(suggestionsOrigen[index].name);
            setShowSuggestionsOrigen(false);
        } else if (index === activeSuggestionIndexDestino) {
            setDestino(suggestionsDestino[index].name);
            setShowSuggestionsDestino(false);
        }
    };
    useEffect(() => {
        // CÃ³digo a ejecutar cuando el componente se monta
        console.log('El componente se ha montado');
    }, []);
    return (
        <div  className={styles.bookingFormContainer}>
            <h2>Buscar Vuelos</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    Origen:
                    <input type="text" className={styles.inputField} value={origen} onClick={() => setShowSuggestionsOrigen(true)} onBlur={() => setTimeout(() => setShowSuggestionsOrigen(false), 100)} onChange={handleOriginChange} />
                    {showSuggestionsOrigen && (
                        <ul>
                            {suggestionsOrigen.map((suggestion, index) => (
                                <li key={index} onClick={() => handleSuggestionClick(index, setOrigen, setDestino, setShowSuggestionsOrigen, setShowSuggestionsDestino)}>
                                    {suggestion.name}
                                </li>
                            ))}
                        </ul>
                    )}
                </label>
                <label>
                    Destino:
                    <input type="text" value={destino} onClick={() => setShowSuggestionsDestino(true)} onBlur={() => setTimeout(() => setShowSuggestionsDestino(false), 100)} onChange={handleDestinationChange} />
                    {showSuggestionsDestino && (
                        <ul>
                            {suggestionsDestino.map((suggestion, index) => (
                                <li key={index} onClick={() => handleSuggestionClick(index, setOrigen, setDestino, setShowSuggestionsOrigen, setShowSuggestionsDestino)}>
                                    {suggestion.name}
                                </li>
                            ))}
                        </ul>
                    )}
                </label>
                <label>
                    DÃ­a:
                    <input type="date" value={dia} onChange={(e) => setDia(e.target.value)} />
                </label>
                <button type="submit" className={styles.button}>Buscar</button>
            </form>
        </div>
    );
}

export default BookingForm  ;
